Kirill Valiavskyi

 Phone: +7 (093) 635-10-00;

Summary:
Project Manager with an overall 5 years experience in software 
development of various kinds with strong interpersonal skills and a 
proven record of successfully delivered IT products. Passionate about 
tackling new challenges, learning, and keeping development and team 
agile. Good at managing priorities, meeting deadlines, understanding 
business values, and timely delivery.

Experience (Ukraine, Kharkiv):
(Dec 2020 - Now) Delivery Manager/ Technical Program Manager
Grid Dynamics

Achievements:

￿ Brought order into the chaos by taking control of project documentation;

￿ Build trusted relationships with stakeholders;

￿ Organized development process using the most suitable agile 
methodologies;

￿ Took responsibility for direct reporting to Senior Management;

(April 2019 - Nov 2020)
Project 

manager / Scrum Master
EPAM 
Systems

Achievements:

￿ 100% delivery of planned increments for the last 10 month;

￿ Under my management project health check value has raised from 2.5 to 
4.25 (out of 5);

￿ Successfully managed a project with over 1M$ budget;

￿ Managed a program with up to 25 engineers (from juniors to leads);

￿ Shared Project Management and Scrum knowledge across the Company 

through webinars and tech-talks;

(June 2014 - April 2019) Project manager
MWDN Ltd.

Achievements:

￿ Researched and found a solution to customer’s problem and was able to 
quadruple the team;

￿ Managed projects from negotiations to closure across all phases;
￿ Completely switch the whole account from Waterfall to Scrum;

Education:

Sep 2009 – Jul 2014
Simon Kuznets Kharkiv National University of Economics,
Master's degree in International Economics

Skills
:
Distributed team management; Communication; Risk Management; 
Budget management; Motivation; Adaptability; Research skills; PM 
Methodologies; Conflict Management; Microsoft Project; Jira; Planning; 
Facilitation; Project documentation; Estimations; Interviewing;

Hobbies:
